import { SingleVideo } from "./singleVideo";

const videoList = [
    {   id: 1,
        name: 'Голова',
        duration: 10,
    },
    {   id: 2,
        name: 'Плечи',
        duration: 20,
    },
    {   id: 3,
        name: 'Руки',
        duration: 30,
    },
    {   id: 4,
        name: 'Тело',
        duration: 40,
    },
    {   id: 5,
        name: 'Ноги',
        duration: 50,
    },
    {   id: 6,
        name: 'ШЛЯПА',
        duration: 60,
    }
]



export function Videos() {
    return (
        <>
            <h1>Список Видео:</h1>
            <div className="videos-wrapper">
                {
                    videoList.map((video) => {
                        return (
                            <>
                                <div className="singleVideo">
                                    <div>video.name</div>
                                    <div>video.duration</div>
                                </div>
                            </>
                        )
                    })
                }
            </div>
        </>
    )
}
